import React from 'react';
import {Text, View, StyleSheet, SafeAreaView, ImageBackground} from 'react-native';
import {Card} from 'antd';
import {PrimaryButton} from '../assets/components/button';
import COLORS from '../assets/components/color';

export default function OnBoard() {
    return (
    <SafeAreaView>
        <View style={style.container}>
        <ImageBackground  style={{flex: 1, justifyContent: "left"}} source={require('../assets/green.png')}>
                <Text style={{fontSize: 62, fontWeight: 'bold', color: COLORS.primary}}>Find Your Needs</Text>
                <PrimaryButton title="SHOP NOW"/>
        </ImageBackground>
        </View>
    </SafeAreaView>
    );
};

const style = StyleSheet.create({
    container: {
        flex: 1
    },
});
